import Hero from "./hero";

class App extends React.Component {
  render() {
    return (
      <>
        <div className="container font-sans">
          <Header />
          <Hero />
          <div className="flex justify-end">
            <Sidebar />
          </div>
        </div>
      </>
    );
  }
}

export default App;
